
create database if not exists company_data;
use company_data;


#
# TABLE STRUCTURE FOR: Branch
#

DROP TABLE IF EXISTS `Branch`;

CREATE TABLE `Branch` (
  `Branch_Name` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Address` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`Branch_Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Department
#

DROP TABLE IF EXISTS `Department`;

CREATE TABLE `Department` (
  `Department_Name` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Department_Head` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Domain` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`Department_Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Software
#

DROP TABLE IF EXISTS `Software`;

CREATE TABLE `Software` (
  `Software_Name` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Version` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Admin_User` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Dev_Contact` int(11) DEFAULT NULL,
  PRIMARY KEY (`Software_Name`,`Version`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: Job_Title
#

DROP TABLE IF EXISTS `Job_Title`;

CREATE TABLE `Job_Title` (
  `Job_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Job_Name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`Job_Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: Employee
#

DROP TABLE IF EXISTS `Employee`;

CREATE TABLE `Employee` (
  `Employee_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `First_Name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Last_Name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Phone_No` int(11) DEFAULT NULL,
  `DOB` date DEFAULT NULL,
  `Joining_Date` date DEFAULT NULL,
  `Salary` float DEFAULT NULL,
  `House_No` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Street_Name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Locality` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `State` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `City` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `PinCode` int(11) DEFAULT NULL,
  `Personal_Email` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Company_Email` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Job_Id` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Branch_Name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Department_Name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`Employee_Id`),
  KEY `C1` (`Job_Id`),
  KEY `C2` (`Branch_Name`),
  KEY `C3` (`Department_Name`),
  CONSTRAINT `C1` FOREIGN KEY (`Job_Id`) REFERENCES `Job_Title` (`Job_Id`),
  CONSTRAINT `C2` FOREIGN KEY (`Branch_Name`) REFERENCES `Branch` (`Branch_Name`),
  CONSTRAINT `C3` FOREIGN KEY (`Department_Name`) REFERENCES `Department` (`Department_Name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Project_
#

DROP TABLE IF EXISTS `Project_`;

CREATE TABLE `Project_` (
  `Project_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Project_Name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Project_Lead` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Client_Id` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Status` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`Project_Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




#
# TABLE STRUCTURE FOR: Dependants
#

DROP TABLE IF EXISTS `Dependants`;

CREATE TABLE `Dependants` (
  `Dependant_No` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Employee_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Relation` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Name` varchar(80) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Phone_No` int(11) DEFAULT NULL,
  `DOB` date DEFAULT NULL,
  PRIMARY KEY (`Dependant_No`,`Employee_Id`),
  KEY `C7` (`Employee_Id`),
  CONSTRAINT `C7` FOREIGN KEY (`Employee_Id`) REFERENCES `Employee` (`Employee_Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Education_entries
#

DROP TABLE IF EXISTS `Education_entries`;

CREATE TABLE `Education_entries` (
  `Branch` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Degree` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Institute` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Year` year(4) NOT NULL,
  `Employee_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`Branch`,`Degree`,`Institute`,`Year`,`Employee_Id`),
  KEY `C5` (`Employee_Id`),
  CONSTRAINT `C5` FOREIGN KEY (`Employee_Id`) REFERENCES `Employee` (`Employee_Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Has_Access
#

DROP TABLE IF EXISTS `Has_Access`;

CREATE TABLE `Has_Access` (
  `Job_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Project_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Software_Name` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Version` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`Job_Id`,`Project_Id`,`Software_Name`,`Version`),
  KEY `C11` (`Project_Id`),
  KEY `C12` (`Software_Name`,`Version`),
  CONSTRAINT `C10` FOREIGN KEY (`Job_Id`) REFERENCES `Job_Title` (`Job_Id`),
  CONSTRAINT `C11` FOREIGN KEY (`Project_Id`) REFERENCES `Project_` (`Project_Id`),
  CONSTRAINT `C12` FOREIGN KEY (`Software_Name`, `Version`) REFERENCES `Software` (`Software_Name`, `Version`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Job_Permissions
#

DROP TABLE IF EXISTS `Job_Permissions`;

CREATE TABLE `Job_Permissions` (
  `Job_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Permissions` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`Job_Id`,`Permissions`),
  CONSTRAINT `C6` FOREIGN KEY (`Job_Id`) REFERENCES `Job_Title` (`Job_Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Middle_Names
#

DROP TABLE IF EXISTS `Middle_Names`;

CREATE TABLE `Middle_Names` (
  `Employee_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Middle_Name` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`Employee_Id`,`Middle_Name`),
  CONSTRAINT `C4` FOREIGN KEY (`Employee_Id`) REFERENCES `Employee` (`Employee_Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Reports_To
#

DROP TABLE IF EXISTS `Reports_To`;

CREATE TABLE `Reports_To` (
  `Supervisor` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Mentee` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`Supervisor`,`Mentee`),
  KEY `C8` (`Mentee`),
  CONSTRAINT `C8` FOREIGN KEY (`Mentee`) REFERENCES `Employee` (`Employee_Id`),
  CONSTRAINT `C9` FOREIGN KEY (`Supervisor`) REFERENCES `Employee` (`Employee_Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: Works_In
#

DROP TABLE IF EXISTS `Works_In`;

CREATE TABLE `Works_In` (
  `Employee_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `Project_Id` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL,
  `From_Date` date DEFAULT NULL,
  `To_Date_` date DEFAULT NULL,
  PRIMARY KEY (`Employee_Id`,`Project_Id`),
  KEY `C14` (`Project_Id`),
  CONSTRAINT `C13` FOREIGN KEY (`Employee_Id`) REFERENCES `Employee` (`Employee_Id`),
  CONSTRAINT `C14` FOREIGN KEY (`Project_Id`) REFERENCES `Project_` (`Project_Id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



